PRAGMA foreign_keys=OFF;

BEGIN TRANSACTION;


CREATE TABLE IF NOT EXISTS "t_Factions"
(
	"ID"	INTEGER NOT NULL UNIQUE,
	"Name"	TEXT NOT NULL UNIQUE,
	PRIMARY KEY("ID" AUTOINCREMENT)
);



CREATE TABLE IF NOT EXISTS "t_SystemIcons"
(
	"ID"			INTEGER NOT NULL UNIQUE,
	"Name"			TEXT NOT NULL UNIQUE,
	"ImageBytes"	BLOB NOT NULL UNIQUE,
	PRIMARY KEY("ID" AUTOINCREMENT)
);



CREATE TABLE IF NOT EXISTS "t_Creatures"
(
	"ID"					INTEGER NOT NULL,
	"FactionID"				INTEGER NOT NULL,
	"ImageBytes_Base"		BLOB NOT NULL,
	"ImageBytes_Upg"		BLOB NOT NULL,
	"ImageBytes_UpgAlt"		BLOB NOT NULL,
	"Tier"					INTEGER NOT NULL,
	"GoldCost_Base"			INTEGER NOT NULL,
	"GoldCost_Upg"			INTEGER NOT NULL,
	"Growth"				INTEGER NOT NULL,
	PRIMARY KEY("ID" AUTOINCREMENT),
	FOREIGN KEY("FK_t_Creatures_FactionID") REFERENCES "t_Factions"("ID")
);



COMMIT;